import React from "react";
import { Container, Nav, Navbar } from "react-bootstrap";
import { Link } from "react-router-dom";

const Header = () => {
  return (
    <>
      <Navbar collapseOnSelect expand="lg" variant="black">
        <Container fluid xxl>
          <Navbar.Brand>
            <Link to={"/"} className="nav-logo">shubham</Link>
          </Navbar.Brand>
          <Navbar.Toggle />
          <Navbar.Collapse>
            <Nav className="justify-content-end" style={{ width: "100%" }}>
              <Nav.Link>
                <Link to={"/login"} className="nav-logo">home</Link>
              </Nav.Link>
              <Nav.Link>
                <Link to={"/register"} className="nav-logo">about</Link>
              </Nav.Link>
              <Nav.Link>
                <Link to={"/register"} className="nav-logo">projects</Link>
              </Nav.Link>
              
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>
    </>
  );
};

export default Header;
